import {makeStyles} from "@material-ui/core/styles";
import React from "react";

export default makeStyles(() => ({
    appBar: {
        borderRadius: 15,
        margin: '30px 0',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
    },
    heading: {
        color: 'rgba(0,183,255, 1)',
    },
    image: {
        marginLeft: '5%',
        maxHeight: '1rem',
        maxWidth: '1rem'
    }
}));
